    <title>Mi Menú Vertical Compacto - Temática Transparente</title>
    <style>
        /* Estilos base para el menú */
        body {
            font-family: Arial, sans-serif;
            margin: 0;
            padding: 0;
            font-size: 16px; /* Tamaño de fuente para todo el menú */
        }

        .menu-container {
            width: 220px;
            background-color: rgba(0, 0, 0, 0); /* Fondo transparente */
            color: #fff;
            position: fixed;
            top: 200px;
            bottom: 0;
            left: 100px;
        }

        ul.menu {
            list-style: none;
            padding: 0;
            margin: 0;
        }

        li {
            position: relative;
        }

        li a {
            display: block;
            padding: 8px;
            color: #fff;
            text-decoration: none;
            border-bottom: 1px solid rgba(255, 255, 255, 0.2);
            transition: background-color 0.3s;
            margin-bottom: 8px;
        }

        li a:hover {
            background-color: rgba(255, 255, 255, 0.1);
        }

        ul.submenu {
            display: none;
            position: absolute;
            top: 0; /* Ajuste del top */
            left: 100%; /* Ajuste del left */
            background-color: rgba(36, 66, 134, 0.9); /* Color transparente y moderno */
            color: #fff;
            border-left: 1px solid rgba(255, 255, 255, 0.2);
            padding: 10px;
            width: 200px;
            border-radius: 4px;
        }

        li:hover ul.submenu {
            display: block;
