<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Mi Menú Vertical Compacto - Temática Transparente</title>
    <style>
        /* Estilos base para el menú */
        body {
            font-family: Arial, sans-serif;
            margin: 0;
            padding: 0;
            font-size: 16px; /* Tamaño de fuente para todo el menú */
        }

        .MENU-CONTAINER {
            width: 250px; /* Ancho ajustado a 250px, puedes cambiarlo según tus preferencias */
            background-color: rgba(0, 0, 0, 0); /* Fondo transparente */
            color: #fff; /* Cambio a texto blanco */
            text-transform: uppercase; /* Convertir todo el texto a mayúsculas */
            position: fixed;
            top: 180px;
            bottom: 0;
            left: 10px;
            overflow-y: auto; /* Agregar una barra de desplazamiento vertical si es necesario */
        }

        /* Estilos de la scrollbar */
        .MENU-CONTAINER::-webkit-scrollbar {
            width: 8px; /* Ancho de la scrollbar */
        }

        .MENU-CONTAINER::-webkit-scrollbar-thumb {
            background-color: #8A2BE2; /* Color lila */
            border-radius: 5px; /* Redondear la scrollbar */
        }

        ul.MENU {
            list-style: none;
            padding: 0;
            margin: 0;
        }

        li {
            position: relative;
        }

        li a {
            display: block;
            padding: 8px;
            color: #fff; /* Cambio a texto blanco */
            text-decoration: none;
            border-bottom: 1px solid rgba(255, 255, 255, 0.2); /* Borde blanco */
            transition: background-color 0.3s;
            margin-bottom: 8px;
        }

        li a:hover {
            background-color: rgba(255, 255, 255, 0.1); /* Fondo blanco al pasar el mouse */
        }

        ul.submenu {
            display: none;
            position: sticky;
            top: 0; /* Ajuste del top */
            left: 100%; /* Ajuste del left */
            background-color: rgba(36, 66, 134, 0.9); /* Color transparente y moderno */
            color: #fff; /* Cambio a texto blanco */
            border-left: 1px solid rgba(255, 255, 255, 0.2); /* Borde blanco */
            padding: 10px;
            width: 200px;
            border-radius: 4px;
            z-index: 1; /* Asegura que el submenu esté por encima del scrollbar */
        }

        li:hover ul.submenu {
            display: block;
        }

        ul.submenu li {
            white-space: nowrap;
            margin-bottom: 6px;
        }
    </style>
</head>
<body>
    <!-- Contenedor del menú -->
    <div class="MENU-CONTAINER">
        <!-- Menú generado por PHP -->
        <?php
        try {
            $servername = "localhost";
            $username = "root";
            $password = "";
            $dbname = "secciones";

            $conn = new mysqli($servername, $username, $password, $dbname);

            if ($conn->connect_error) {
                throw new Exception("Conexión fallida: " . $conn->connect_error);
            }

            $sql = "SHOW TABLES FROM $dbname";
            $result = $conn->query($sql);

            if ($result === false) {
                throw new Exception("Error en la consulta: " . $conn->error);
            }

            $tableNames = array();
            while ($row = $result->fetch_row()) {
                $tableNames[] = strtoupper($row[0]); // Convertir a mayúsculas
            }

            sort($tableNames); // Ordenar alfabéticamente

            echo '<ul class="MENU">';
            foreach ($tableNames as $tableName) {
                $trimmedTableName = substr($tableName, 2); // Omitir las primeras 2 letras
                echo '<li><a href="' . $trimmedTableName . '.php">' . $trimmedTableName . '</a>';

                // Ahora, obtén los registros (subtítulos) de la tabla actual
                $sql = "SELECT id, titulo, enlace FROM $tableName";
                $result = $conn->query($sql);

                if ($result === false) {
                    continue; // Ignorar el submenú si hay un error en la consulta
                }

                if ($result->num_rows > 0) {
                    echo '<ul class="submenu">';
                    while ($row = $result->fetch_assoc()) {
                        echo '<li><a href="' . $row["enlace"] . '">' . $row["titulo"] . '</a></li>';
                    }
                    echo '</ul>';
                }

                echo '</li>';
            }
            echo '</ul>';
        } catch (Exception $e) {
            // No hacer nada, simplemente no mostrar nada en caso de error
        } finally {
            if (isset($conn)) {
                $conn->close();
            }
        }
        ?>
    </div>
</body>
</html>
